(69, 'Текст объявления диски авито', 'Данный товар поставляется на заказ (находится в г. [+ATTR=27+]). Указана конечная цена в г. [+ATTR=38+]. (Могу отправить в любые города в РФ РК РБ транспортными компаниями). \r\n[+LIST=18+]  Продаются без шин, но могу укомплектовать шинами за отдельные деньги. Диски не гнутые, не треснутые, не вареные, внешний вид на фото. Товар б/у. Обмен не интересен. Возможен резерв товара на срок до месяца по предоплате.\r\n\r\n[+INTER=20+]\r\n\r\nБолее 100 положительных отзывов от покупателей из других городов на самом крупном автомобильном сайте РФ. Сделаю дополнительные фото, отвечу на ваши вопросы.\r\n', 2, 'managerActions', 0, 1),
