(104, 'Наличие шипов для дрома (автовыкладка)', '[+LIST=37+]', 1, 'rootActions', 0, 2),
(105, 'Сверловка дром (автовыкладка)', '[+ATTR=5+]', 2, 'rootActions', 0, 2),
