('DOSD_Нижний Новгород_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Новосибирск_3525927', '`("[+ATTR=27+]"!="Новосибирск")?("наличные указана конечная цена с доставкой на наш склад в г. Новосибирск доставка по городу Новосибирску 500р могу отправить в любой город транспортной компанией (+500р)"):("наличные\r\nдоставка по городу 500р\r\nмогу отправить в любой город транспортной компанией (+500р)")`\r\n\r\n'),
('DOSD_Новосибирск_wheels70', 'Самовывоз ул. Большевистская, ТОЛЬКО по предварительной договоренности.\r\nДоставка по городу 500р\r\nМогу отправить в любой город Транспортными компаниями.\r\nСтоимость доставки до ТК и оформления документов на отправку 500р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до ТК и оформления документов 500р. за 4 диска.\r\n\r\nСпособы оплаты:\r\nналичными, карта сбербанк, альфабанк'),
('DOSD_Омск_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Ростов-на-дону_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Санкт-петербург_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Ставрополь_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Сургут_reg', 'Товар находится в г. [+ATTR=27+]. Доставка до города размещения объявления включена в цену. При бесплатной доставке выбор тк остается за нами. Сроки отправки товара при бесплатной доставке составляют до 4 дней. наличными, карта сбер, альфабанк'),
('DOSD_Томск_kolesotomskru', '`("[+ATTR=27+]"!="Томск")?("Наличные указана конечная цена с доставкой на наш склад в г. Томск доставка по городу Томску 300р могу отправить в любой город транспортной компанией (+400р)"):("наличные\r\nдоставка по городу 300р\r\nмогу отправить в любой город транспортной компанией (+400р)")`'),
('DOSD_Томск_wheels70', 'Самовывоз г. Томск, район пл. Южной, ТОЛЬКО по предварительной договоренности по телефону.\r\nПо предоплате могу доставить по г. Томску\r\nОтправляю в регионы любой ТК на ваш выбор\r\nПредлагается: ПЭК, РАТЭК, Деловые линии, Желдорэкспедиция, Автотрейдинг, Кит, Энергия. \r\nСтоимость доставки до тк и оформления документов на отправку 300р. за 2 или 4 шины. \r\nСтоимость упаковки дисков в картон, доставки до тк и оформления документов 400р. за 4 диска.\r\n\r\nСтоимость и сроки доставки до вашего города узнавайте на сайте ТК \r\n1. Выбираете тк\r\n2. Вводите название тк в гугл\r\n3. Переходите на сайте в раздел \\"калькулятор\\". \r\nПриблизительные параметры комплекта резины: 0,35м2 - 45кг.\r\nПриблизительные параметры комплекта дисков: 0,22м2 - 45кг.\r\nПриблизительные параметры комплекта колес: 0,4м2 - 85кг.\r\n\r\nСпособы оплаты:\r\nналичными, карта сбербанк, альфабанк'),
